import React, { Component, Img } from 'react';
import cage from './partials/cage.jpg';
import './App.css';
import Header from './partials/Header';


class App extends Component {
  state = {
    w: 0,
    h: 0
  }
  changeImgSize () {
    this.setState({
      w: this.props.w,
      h: this.props.h
    })
  }
  render() {
    return (
      <div className="App">
        <Header/>
        <Img src={cage} height='300' width='300'/>
      </div>
    );
  }
}

export default App;
